        return (
           <div className="row">
            <div className="col-lg-4">
                <div className="card mb-4 shadow-sm">
<img src="https://image.tmdb.org/t/p/w600_and_h900_bestv2/dXNAPwY7VrqMAo51EKhhCJfaGb5.jpg" className="card-img-top" alt="Sample Movie"/>
               <div className="card-body">
                <h5 className="car-title">Sample Movie</h5>
                <p className="card-text">Sample Movie Description</p>
                <div className="d-flex justify-content-between align-items-center">
                    <button type="button" className="btn btn-md btn-outline-danger">
                        
                    </button>
                </div>
               </div>
                </div>
            </div>
           </div>
        )
    }
}

export default MovieList;
